import React, { useEffect } from "react";
import { groupBy } from "lodash";
import RecentlyAdded from "../components/modules/recently-added";
import mockData from "../data.json";

const playlistIds = [
  "PLtAzkECGU1yXDNefSuSbxODu9hrRK0UtP",
  "PLtAzkECGU1yXhKBF1t-pJmH8S1nuBiu8z",
];

const VideoLibrary = () => {
  useEffect(() => {
    (async () => {
      try {
        const res = await fetch(
          "https://www.googleapis.com/youtube/v3/playlists?" +
            new URLSearchParams({
              /* part: "id,snippet",
                    key: "AIzaSyCAH8cKrD6ASDhtfMYIfEGzNU6v9mcltRI",
                    channelId: "UCHBDAkjxufCaEfmRaf7Bj3Q",
                    maxResults: 200, */
              key: "AIzaSyCAH8cKrD6ASDhtfMYIfEGzNU6v9mcltRI",
              part: "id,contentDetails,snippet,status",
              id:
                "PLtAzkECGU1yXDNefSuSbxODu9hrRK0UtP,PLtAzkECGU1yXhKBF1t-pJmH8S1nuBiu8z",
            })
        );
        const resJson = await res.json();
        console.log("data==>>", resJson);
        //   console.log("data==>>", groupBy(mockData.items, "id.kind"));
      } catch (err) {
        console.log("err==>>", err);
      }
    })();
  }, []);

  return (
    <div>
      Hello
      <RecentlyAdded />
    </div>
  );
};

export default VideoLibrary;
